import { Link } from 'react-router-dom';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

function BackButton() {
  return (
    <>
      <Row>
        <Col>
          <Link to="/">
            <i class="fa-solid fa-arrow-left"></i>Back
          </Link>
        </Col>
      </Row>
    </>
  );
}

export default BackButton;
